import React,{useEffect, useState} from 'react';
import Button from './buttonLogin';
import Option from './option';
import { NavBarDropdown } from './navBarDropdown';
import { Cards } from './cards';


export default function TutorNotifications() {
    return (
        <>
        <h1>Notifications</h1>
        <ul class="list-group">
  <li class="list-group-item bg-success-subtle"><p class="bg-success-subtle">Someone has accepted your tuition request for subject<b>Java</b></p></li>
  <li class="list-group-item .text-danger-emphasis">Someone has rejected your tuition request for subject<b>C++</b></li>
  <li class="list-group-item .text-warning-emphasis">Your request is pending with this teacher for subject<b>Python</b></li>
  <li class="list-group-item">A fourth item</li>
  <li class="list-group-item">And a fifth one</li>
</ul>
        </>
    )
}
